import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // ✅ Added React Router
import Login from "./components/Login";
import AdminDashboard from "./components/AdminDashboard";
import LandlordDashboard from "./components/LandlordDashboard";
import FullPageScroll from "./components/FullPageScroll";
import HouseListing from "./components/HouseListing"; // ✅ Ensure HouseListing is imported

const App = () => {
  return (
    <Router>  {/* ✅ Wrap everything inside Router */}
      <Routes>
        <Route path="/" element={<FullPageScroll />} /> {/* Home Page */}
        <Route path="/login" element={<Login />} /> {/* Login Page */}
        <Route path="/admin-dashboard" element={<AdminDashboard />} /> {/* Admin Dashboard */}
        <Route path="/landlord-dashboard" element={<LandlordDashboard />} /> {/* Landlord Dashboard */}
        <Route path="/houses" element={<HouseListing />} /> {/* House Listings */}
      </Routes>
    </Router>
  );
};

export default App;
